    "2016-07-15T04:23:25.376034",nt"name": "marketplace-products",nt"isopen":
    true,nt"url": null,nt"notes": "<p>The Office of Enterprise Data and Analytics,
    within the Centers for Medicare aqnd Medicaid Services (CMS), has developed a set
    of information products and analytics examining enrollment activity in the Health
    Insurance Marketplaces (the Marketplaces).  The Marketplaces were established in
    2014 and allow individuals to shop for health insurance and dental plans.  While
    some of the data products available here include data for all 50 states and the
    District of Columbia, other products focus only on states that utilize the Healthcare.gov
    platform (38 states in 2016).  Each product clearly defines the population.  Caution
    is recommended when comparing annual data as the definitions for some variables
    have changed from one reporting period to another.  These changes are noted in the
    affected products.</p>n",nt"license_title": "Other License Specified",nt"extras":
